INSERT INTO `birthday_login_bonus_drama_script` VALUES (/*command_id*/1009501040, /*drama_id*/1009501, /*command_type*/11, /*param_01*/100911, /*param_02*/"我が降誕の日を覚えていたとは……\nさすがは前世からの盟友だな！\n礼を言うぞ、シグルドよ！", /*param_03*/5, /*param_04*/1, /*param_05*/1, /*param_06*/0, /*param_07*/0, /*param_08*/"");
