INSERT INTO `birthday_login_bonus_drama_script` VALUES (/*command_id*/1009501046, /*drama_id*/1009501, /*command_type*/11, /*param_01*/100911, /*param_02*/"しかし、これだけの大きさ……\n我一人で太刀打ちできるかどうか……\nシグルドよ、手伝ってくれるか？\nそうか！　助かるぞ！", /*param_03*/5, /*param_04*/1, /*param_05*/1, /*param_06*/0, /*param_07*/0, /*param_08*/"");
