INSERT INTO `birthday_login_bonus_drama_script` VALUES (/*command_id*/1027501040, /*drama_id*/1027501, /*command_type*/11, /*param_01*/102711, /*param_02*/"これは……私の誕生日祝い……？\nまぁ……！　まぁ……！！！\nあなた様の熱い気持ちを感じますわ。\nあぁ。本当にうれしい……！", /*param_03*/4, /*param_04*/1, /*param_05*/1, /*param_06*/0, /*param_07*/0, /*param_08*/"");
