INSERT INTO `birthday_login_bonus_drama_script` VALUES (/*command_id*/1027501043, /*drama_id*/1027501, /*command_type*/11, /*param_01*/102711, /*param_02*/"このケーキもあなた様が……\nさっそく一緒に味わいませんか？\nせっかくのお祝いなのですから。\nあなた様と共に楽しみたいのです。", /*param_03*/5, /*param_04*/1, /*param_05*/1, /*param_06*/0, /*param_07*/0, /*param_08*/"");
INSERT INTO `birthday_login_bonus_drama_script` VALUES (/*command_id*/1027501044, /*drama_id*/1027501, /*command_type*/91, /*param_01*/0, /*param_02*/"", /*param_03*/"", /*param_04*/"", /*param_05*/"", /*param_06*/"", /*param_07*/"", /*param_08*/"");
INSERT INTO `birthday_login_bonus_drama_script` VALUES (/*command_id*/1027501045, /*drama_id*/1027501, /*command_type*/21, /*param_01*/"vo_adv_1027501", /*param_02*/"vo_adv_1027501_002", /*param_03*/0, /*param_04*/0, /*param_05*/"", /*param_06*/"", /*param_07*/"", /*param_08*/"");
INSERT INTO `birthday_login_bonus_drama_script` VALUES (/*command_id*/1027501046, /*drama_id*/1027501, /*command_type*/11, /*param_01*/102711, /*param_02*/"では、私が切り分けますね。\nこれは、あなた様のぶん。\n……クスクス。\nこちらのケーキには、この薬を一滴……", /*param_03*/5, /*param_04*/1, /*param_05*/1, /*param_06*/0, /*param_07*/0, /*param_08*/"");
INSERT INTO `birthday_login_bonus_drama_script` VALUES (/*command_id*/1027501047, /*drama_id*/1027501, /*command_type*/91, /*param_01*/0, /*param_02*/"", /*param_03*/"", /*param_04*/"", /*param_05*/"", /*param_06*/"", /*param_07*/"", /*param_08*/"");
