INSERT INTO `birthday_login_bonus_drama_script` VALUES (/*command_id*/1027501049, /*drama_id*/1027501, /*command_type*/11, /*param_01*/102711, /*param_02*/"あら、青い顔をしてどうしましたか？\n大丈夫です、なにも怖くありませんわ。\nこの一口で、今よりさらに\n私への想いが燃え上がるだけですから。", /*param_03*/5, /*param_04*/1, /*param_05*/1, /*param_06*/0, /*param_07*/0, /*param_08*/"");
