INSERT INTO `birthday_login_bonus_drama_script` VALUES (/*command_id*/1068501043, /*drama_id*/1068501, /*command_type*/11, /*param_01*/106811, /*param_02*/"このケーキ、少年の手作りでしょ？\nそりゃあ一目見れば分かるよ。\nこれでもクレープ屋の店長だからね！", /*param_03*/6, /*param_04*/1, /*param_05*/1, /*param_06*/0, /*param_07*/0, /*param_08*/"");
