INSERT INTO `birthday_login_bonus_drama_script` VALUES (/*command_id*/1068501046, /*drama_id*/1068501, /*command_type*/11, /*param_01*/106811, /*param_02*/"少年がどんな気持ちで\nケーキを作ってくれたのかも\nちゃーんと伝わってるよ\nたくさん手間をかけてくれたこともさ。", /*param_03*/6, /*param_04*/1, /*param_05*/1, /*param_06*/0, /*param_07*/0, /*param_08*/"");
