INSERT INTO `birthday_login_bonus_drama_script` VALUES (/*command_id*/1068501049, /*drama_id*/1068501, /*command_type*/11, /*param_01*/106811, /*param_02*/"それにしても立派なケーキだなぁ。\nこのサイズ感にこのインパクト……\n待てよ、これってうちのクレープにも\n何か活かせないかな？　とすれば……", /*param_03*/5, /*param_04*/1, /*param_05*/1, /*param_06*/0, /*param_07*/0, /*param_08*/"");
